import React, { Component } from "react";
import "./css/audio.css";
import "./css/playButton.css";
import "./css/reset.css";
import "./js/html5audio";

class Listens extends Component {
  render() {
    return (
      <div>
        <audio id="music" preload="true">
          <source src="music/interlude.mp3" />
          <source src="music/interlude.ogg" />
        </audio>

        <div id="wrapper">
          <div id="audioplayer">
            <button id="pButton" className="play"></button>
            <div id="timeline">
              <div id="playhead"></div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Listens;
